import React from 'react';

function Pin(props) {
    return (
        <Wrapper>
            <Container>
                <img src="https://images.unsplash.com/photo-1622182438074-b163bdf8f16c?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1281&q=80" />
            </Container>
        </Wrapper>
    );
}

export default Pin;


const Wrapper = styled.div`
display: inline-flex;
padding: 8px;

`
    ;

const Container = styled.div`
    display: flex;
    align-items: center;
    box-sizing: border-box;
    cursor: pointer;
    width: 236px;

    img {
